class Solution {
public:
    int findClosestNumber(vector<int>& nums) {
         int ans=INT_MAX;
        int val;
        for(auto x:nums){
            if(abs(x)<ans){
                ans=abs(x);
                val=x;
            }
            else if(abs(x)==ans){
                if(val<x){
                    val=x;
                }
            }
        }

        return val;
    }
};
